import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import hospimain from './components/Images/hospimain.jpeg';

function App() {
  return (
    <div>
      <Navbar />
      <div>
      <img
        src={hospimain}
        alt="img should"
        style={{ width: '100%', maxHeight: '600px', filter: 'blur(5px)' }}
      />
      </div>
      <Footer/>
    </div>
  );
}

export default App;
